import React from "react";

import HeroSlider from "../components/UI/HeroSlider";
import Helmet from "../components/Helmet/Helmet";

import { Container, Row, Col } from "reactstrap";
import FindCarForm from "../components/UI/FindCarForm";
import AboutSection from "../components/UI/AboutSection";
import ServicesList from "../components/UI/ServicesList";
import carData from "../assets/data/carData";
import CarItem from "../components/UI/CarItem";
import BecomeDriverSection from "../components/UI/BecomeDriverSection";
import Testimonial from "../components/UI/Testimonial";

import BlogList from "../components/UI/BlogList";

const Home = () => {
  return (
    <Helmet title="Cars">
    <section className="car-listing">
      <Container>
        <Row>
          <Col lg="3" md="4" className="sidebar">
            <h4 className="sidebar-title">Filters</h4>
            <Form>
              <FormGroup>
                <Label for="pickupLocation">Pick Up</Label>
                <Input type="select" id="pickupLocation">
                  <option>Select Pickup Location</option>
                  {locations.map((location, index) => (
                    <option key={index} value={location}>{location}</option>
                  ))}
                </Input>
              </FormGroup>
              <FormGroup>
                <Label for="pickupDate">Date</Label>
                <Input type="date" id="pickupDate" />
              </FormGroup>
              <FormGroup>
                <Label for="pickupTime">Time</Label>
                <Input type="select" id="pickupTime">
                  <option>Select Pickup Time</option>
                  {times.map((time, index) => (
                    <option key={index} value={time}>{time}</option>
                  ))}
                </Input>
              </FormGroup>
              <FormGroup>
                <Label for="dropoffLocation">Drop Off</Label>
                <Input type="select" id="dropoffLocation">
                  <option>Select Drop-off Location</option>
                  {locations.map((location, index) => (
                    <option key={index} value={location}>{location}</option>
                  ))}
                </Input>
              </FormGroup>
              <FormGroup>
                <Label for="dropoffDate">Date</Label>
                <Input type="date" id="dropoffDate" />
              </FormGroup>
              <FormGroup>
                <Label for="dropoffTime">Time</Label>
                <Input type="select" id="dropoffTime">
                  <option>Select Drop-off Time</option>
                  {times.map((time, index) => (
                    <option key={index} value={time}>{time}</option>
                  ))}
                </Input>
              </FormGroup>
            </Form>
          </Col>

          <Col lg="9" md="8" className="car-items">
            <Row>
              {carData.map((item) => (
                <CarItem item={item} key={item.id} />
              ))}
            </Row>
          </Col>
        </Row>
      </Container>
    </section>
  </Helmet>
);
};



